(314, '2019-06-20 21:17:24', 'no user', 'recorded ballot ', 'Array\n(\n    [ballot] => Array\n        (\n            [Keyphrase] => test 123\n            [Question] => Array\n                (\n                    [1] => 1edc1a261c1ef1c4f4233041564a244d\n                )\n\n            [Comment] => Array\n                (\n                    [2] => wow this is great to see the new version work...\r\n\r\nTake for example the TEXT type. It can contain 65535 bytes of data. UTF-8 contains multi-byte characters. Therefore, if you filled the field using only the danish character \"\", you would only get 32767 characters, as that UTF-8 character is composed of two bytes. If you filled it with \"a\", you would get 65535 characters.  Andrew Plank Sep 18 \'13 at 10:36 \n                )\n\n        )\n\n    [response] => Array\n        (\n            [survey_name] => \n            [seq_no] => 128046\n            [ballot_id] => 943\n            [timestamp] => \n            [rank] => STAFF\n            [department] => \n            [keyphrase] => test 123\n        )\n\n)\n'),
