(1068, '2019-07-25 15:38:25', 'wdcohen', 'update question', 'Array\n(\n  [id] => 451\n  [ballot_id] => 298\n  [parm_no] => 4\n  [question] => CS 231P Parallel and Distributed\nComputing Approve new course as an MCS\nelective\n<br>\n<br>\nThe MS program has a similar course (CS\n230 Distributed Computer Systems) that\nis currently being offered this Winter\nquarter that is in high demand. \nInitially, the MS course had a maximum\ncapacity of 45 students, but has since\nincreased its capacity to 60 students in\norder to service student demand. MCS\nexpects a similar trend if this course\nis approved. \n<br>\n<br>\nHaving CS 230P will allow for a more\nwell rounded curriculum and option for\nstudents who have an interest in\ndistributed computing systems. \nCurrently, the list of electives that\nare offered in MCS are:\n<br>\nCS 201P Introduction to Computer Security\n<br>\nCS 202P Applied Cryptography\n<br>\nCS 203P Network Security\n<br>\nCS 206P Principles of Scientific Computing\n<br>\nCS 210P Computer Graphics and Visualization\n<br>\nCS 211P Visual Computing\n<br>\nCS 242P Compilers and Interpreters\n<br>\nCS 244P Introduction to the Internet of\nThings\n<br>\nCS 253P Advanced Programming and Problem\nSolving\n<br>\nCS 262P Automata and Grammars\n<br>\nCS 267P Data Compression\n<br>\nCS 268P Introduction to Optimization\nModeling\n<br>\nCS 271P Introduction to Artificial\nIntelligence\n<br>\nCS 274P Neural Networks and Deep Learning\n  [input_type] => Radio\n  [display_order] => 5\n)\n'),
