(339, 84, 130108, 2, 1, ' It\'s great to have Matt as a colleague! '),
(341, 84, 130110, 2, 1, ' This is a well-deserved promotion for a person who is <BR>an invaluable part of our department. '),
(351, 84, 130120, 2, 1, ' Matt is a wonderful colleague and I vote in <BR>enthusiastic support! '),
(352, 84, 130121, 2, 1, ' He\'s a great colleague. He\'s a great colleague. He\'s a great colleague.'),
(990, 215, 128373, 2, 1, ' The changes should not affect any <BR>existing ballots as the rank is <BR>recorded when the ballot is sent.<BR><BR>Please edit the faculty to change the <BR>ranks.  <BR><BR>Let me know if you need anything else.<BR><BR>Bill<BR>'),
(989, 215, 128372, 2, 1, ' I do not know why this has happened'),
(985, 206, 128305, 2, 1, ' It is with the utmost enthusiasm that I vote in <BR>support of Aaron\'s merit promotion.'),
(955, 189, 27688, 2, 1, ' Good job!'),
(950, 189, 27682, 2, 1, ' Don\'t feel comfortable voting quite yet with not <BR>enough context.'),
(948, 189, 27679, 2, 1, ' His work is above and beyond what is <BR>required for this promotion - he is <BR>building a major research program.'),
(945, 186, 27722, 2, 1, ' Kai has been an excellent addition to our <BR>department. In the next few years, I look <BR>forward to watching him step into <BR>important international leadership roles <BR>and bring his research agenda to the next <BR>level.'),
(916, 149, 27098, 2, 1, ' Sam has achieved an amazing amount of new <BR>research in the short time since he has come to <BR>UCI, including an astonishing amount of new <BR>research funding. His dedicated mentoring resulted <BR>in an excellent placement for a PostDoc. Also, Sam <BR>is a good colleague, always ready to talk about <BR>research. Its great to have him in our Department. '),
(901, 149, 27038, 2, 1, ' Excellent case.'),
(885, 148, 27037, 2, 1, ' Great case.'),
(868, 146, 27148, 2, 1, ' Kurt will be a great addition to our<BR>faculty.'),
(839, 131, 26849, 2, 1, ' Bonnie has the makings of a superstar. Besides <BR>having solid research, she has a dynamic presence <BR>that will help her build programs and communities, <BR>a talent that will be an asset to the games program <BR>at UCI, but also support her working across <BR>various campus communities. '),
(834, 131, 26839, 2, 1, ' The work of Dr. Ruberg is<BR>methodologically very shallow. I don\'t<BR>think she is a good fit for our department. '),
(833, 131, 26835, 2, 1, ' I am very enthusiastic about Dr. Ruberg\'s appointment <BR>and look forward to her joining our team.'),
(820, 130, 26848, 2, 1, ' Aaron is an excellent candidate for the games <BR>program and has much to offer in the area of HCI <BR>and the Department in general. Looking forward to <BR>having him on board. '),
(781, 120, 128039, 4, 1, ' Jonathan is awesome!'),
(761, 115, 27099, 2, 1, ' support no action. '),
(957, 189, 27721, 2, 1, ' Matt is a real treat to have around. I <BR>look forward to continuing to watch him <BR>bloom into the excellent researcher he has <BR>the potential and has already begun to be.'),
(949, 189, 27680, 2, 1, ' You\'re doing great. We are really happy to have you with <BR>us.'),
(941, 186, 27678, 2, 1, ' I had to leave early and don\'t feel comfortable <BR>voting. Please don\'t take it as a lack of support.'),
(899, 148, 27096, 2, 1, ' Congrats on all of your achievements, especially <BR>the impact paper award and the excellent <BR>placement of your PhD student!'),
(883, 147, 27097, 2, 1, ' Nardi\'s intellectual impact on the research <BR>community is exceptional and her insights and <BR>passion for her work inspire many. I am grateful to <BR>have her as a colleague in our Department. '),
(853, 145, 27146, 2, 1, ' Professor Steinkuehler has only<BR>published few high-quality articles<BR>since 2012, hence the rank of full<BR>professor seems too high for her.'),
(814, 130, 26834, 2, 1, ' Dr. Trammell will be an excellent asset to both the <BR>department and the campus.'),
(815, 130, 26838, 2, 1, ' Excellent candidate, great to have him<BR>on board.'),
(755, 115, 27053, 2, 1, ' judith\'s research productivity is low.'),
